import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Logo from 'components/Logo';
import { withRouter } from 'react-router';
import Modal from 'react-modal';

class NavbarLayout extends Component {
  state = {
    showModal: false,
  };

  componentDidMount() {
    this.updateWindowDimensions();
    window.addEventListener('resize', this.updateWindowDimensions);
  }

  componentWillUnmount() {
    window.removeEventListener('resize', this.updateWindowDimensions);
  }

  updateWindowDimensions = () => {
    this.setState({ width: window.innerWidth, height: window.innerHeight });
  };

  render() {
    if (this.state.width < 600) {
      return (
        <div>
          <div className={'Navbar'}>
            <Logo />
            <button
              style={{ width: 'auto', background: 'none', color: 'black' }}
              onClick={() =>
                this.setState({ showModal: !this.state.showModal })
              }
            >
              <i className="fas fa-bars" style={{ fontSize: 24 }}></i>
            </button>
          </div>
          <Modal
            closeTimeoutMS={200}
            isOpen={this.state.showModal}
            onRequestClose={() => this.setState({ showModal: false })}
            style={{
              content: {
                border: 'none',
                boxShadow:
                  '0 10px 16px 0 rgba(0,0,0,0.2),0 6px 20px 0 rgba(0,0,0,0.19)',
                left: 15,
                right: 15,
                top: 20,
                bottom: 'auto',
                minHeight: 500,
                maxHeight: '90%',
                padding: 10,
              },
              overlay: {
                background: 'none',
              },
            }}
          >
            <button
              onClick={() => this.setState({ showModal: false })}
              style={{ width: 'auto', height: 'auto', float: 'right' }}
            >
              <i className="fas fa-times"></i>
            </button>
            <div style={{ padding: 10, marginTop: 30 }}>
              <Link to="/login">
                <div style={{ width: '100%' }}>Log In</div>
              </Link>
              <div style={{ height: 20 }} />
              <Link to="/register">
                <div style={{ width: '100%' }}>Sign Up</div>
              </Link>
              <div style={{ height: 20 }} />
              <Link
                to="/#what-we-do"
                onClick={() => this.setState({ showModal: false })}
              >
                <div style={{ width: '100%' }}>What we do</div>
              </Link>
              <div style={{ height: 20 }} />
              <Link
                to="/about"
                onClick={() => this.setState({ showModal: false })}
              >
                <div style={{ width: '100%' }}>About us</div>
              </Link>
            </div>
          </Modal>
          <div className={'NavbarContent'}>{this.props.children}</div>
        </div>
      );
    }

    return (
      <div>
        <div className={'Navbar'}>
          <Logo />
          <div style={{ display: 'flex', alignItems: 'center' }}>
            <div style={{ width: 100, marginRight: 20 }}>
              <Link to="/login">Log In</Link>
            </div>
            <button onClick={() => this.props.history.push('/register')}>
              Sign Up
            </button>
          </div>
        </div>
        <div className={'NavbarContent'}>{this.props.children}</div>
      </div>
    );
  }
}

export default withRouter(NavbarLayout);
